import React from 'react';
import { Link } from 'react-router-dom';
import { Button } from 'primereact/button';
import 'assets/css/foodhut.css'; // Importar el archivo CSS desde la carpeta assets
import blogImg1 from 'assets/imgs/blog-1.jpg'; // Importar la imagen blog-1.jpg desde la carpeta assets
import blogImg2 from 'assets/imgs/blog-2.jpg'; // Importar la imagen blog-2.jpg desde la carpeta assets
// Importar las demás imágenes según sea necesario

function HomePage() {
  return (
    <div className="container-fluid">
      {/* Navbar */}
      <nav className="custom-navbar navbar navbar-expand-lg navbar-dark fixed-top" data-spy="affix" data-offset-top="10">
          {/* Agregar aquí el contenido de la barra de navegación */}
      </nav>

      {/* Header */}
      <header id="home" className="header">
          {/* Agregar aquí el contenido del header */}
      </header>

      {/* About Section */}
      <div id="about" className="container-fluid wow fadeIn" id="about"data-wow-duration="1.5s">
          {/* Agregar aquí el contenido de la sección About */}
      </div>

      {/* Gallary Section */}
      <div id="gallary" className="text-center bg-dark text-light has-height-md middle-items wow fadeIn">
          {/* Agregar aquí el contenido de la sección Gallary */}
      </div>

      {/* Book a Table Section */}
      <div className="container-fluid has-bg-overlay text-center text-light has-height-lg middle-items" id="book-table">
          {/* Agregar aquí el contenido de la sección Book a Table */}
      </div>

      {/* Blog Section */}
      <div id="blog" className="container-fluid bg-dark text-light py-5 text-center wow fadeIn">
          {/* Agregar aquí el contenido de la sección Blog */}
      </div>

      {/* Reviews Section */}
      <div id="testmonial" className="container-fluid wow fadeIn bg-dark text-light has-height-lg middle-items">
          {/* Agregar aquí el contenido de la sección Reviews */}
      </div>

      {/* Contact Section */}
      <div id="contact" className="container-fluid bg-dark text-light border-top wow fadeIn">
          {/* Agregar aquí el contenido de la sección Contact */}
      </div>

      {/* Page Footer */}
      <div className="container-fluid bg-dark text-light has-height-md middle-items border-top text-center wow fadeIn">
          {/* Agregar aquí el contenido del footer */}
      </div>
    </div>
  );
}

export default HomePage;
